Third time using custom routine brand @ourxhair in a month, and first time doing a braid-out in a loooooong time! My first experience using OurX was really good so I wanted to keep using it consistently to note how my hair and scalp responded to it over time. So far it’s a win — my hair & scalp feel clean & moisturized, and the scalp products control flakiness and irritation which I love! The purple tool I used is the @luxetherapy scalp soother and it gently lifts dirt and product build up from the scalp. It’s linked on my Amazon in my bio. Stay tuned for part 2 to see what I used to get my braid-out, and how I use their scalp products too. 🪮➰🖤

What I used:
@ourxhair Pre-cleanse Oil
OurX Detox Cleanse Complex
OurX Nutrient Cleanse Complex
@daehair Alligator Clips
@luxetherapy Scalp Soother (linked on my Amazon in bio)

